import "./About.scss";
const About = () => {
  const holder = undefined;
  return (
  <section>
    <div className="title" style={holder}>About Me</div>
    <div className="about-me">Clean, dynamic Front-end developer creating memorable and smooth user experiences</div>
  </section>);
};

export default About;
